import styled from 'styled-components';
import RandomRecipes from '../RandomRecipes/RandomRecipes';

function CardView() {
	return (
		<CardWrapper>
			<RandomRecipes />
		</CardWrapper>
	);
}

export const CardWrapper = styled.div`
	display: flex;
	width: 75vw;
	align-items: right;
	flex-wrap: nowrap;
	margin: auto;
`;
export default CardView;
